import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Pim from './Pim';
import Employeelist from './pim/Employeelist';
import Addemployee from './pim/Addemployee';

export default function App() {
  return (
    <Router>
      <Switch>
        <Route path="/pim" component={Pim} />
        <Route path="/pim/employeelist" component={Employeelist} />
        <Route path="/pim/addemployee" component={Addemployee} />
      </Switch>
    </Router>
  );
}
